import React from "react";
import { Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <>
      <Row>
      <Col>
          <div className="footer-style">2022 &#9827; Angelo Fantino</div>      
      </Col>
    </Row>
    
    </>
  );
}

export default Footer;
